```processing
void setup() {
  size(800, 600);
}

void draw() {
  background(255);
  drawLine();
  drawGuitar();
}

void drawLine() {
  stroke(0);
  strokeWeight(5);
  line(0, 50, width, 50);
}

void drawGuitar() {
  // Guitar body
  fill(200, 100, 50);
  ellipse(width/2, height/2, 200, 300);

  // Guitar neck
  fill(100, 50, 0);
  rect(width/2 - 25, height/2 - 150, 50, 200);

  // Guitar strings
  stroke(150);
  strokeWeight(2);
  for (int i = 0; i < 6; i++) {
    line(width/2 - 20 + i * 8, height/2 - 150, width/2 - 20 + i * 8, height/2 + 150);
  }

  // Guitar bridge
  fill(0);
  rect(width/2 - 40, height/2 + 100, 80, 10);

  // Guitar head
  fill(100, 50, 0);
  rect(width/2 - 40, height/2 - 350, 80, 50);

  // Guitar tuning pegs
  fill(0);
  for (int i = 0; i < 6; i++) {
    if (i < 3) {
      ellipse(width/2 - 35 + i * 20, height/2 - 340, 10, 10);
    } else {
      ellipse(width/2 - 35 + (i - 3) * 20, height/2 - 320, 10, 10);
    }
  }
}
```

