void setup() {
  size(800, 600);
  background(255);
}

void draw() {
  // Draw the line at the top
  stroke(0);
  strokeWeight(5);
  line(0, 50, width, 50);

  // Draw the trumpet in the middle
  noStroke();
  fill(255, 215, 0); // Gold color

  // Main body of the trumpet
  ellipse(width/2, height/2, 200, 100);
  rect(width/2 - 100, height/2 - 50, 100, 100);

  // Leadpipe
  rect(width/2 - 200, height/2 - 25, 100, 50);

