  bezierVertex(width/2 + 150, height/2 - 50, width/2 + 200, height/2 - 100, width/2 + 250, height/2);
  bezierVertex(width/2 + 200, height/2 + 100, width/2 + 150, height/2 + 50, width/2 + 100, height/2 + 50);
  endShape(CLOSE);

  // Valves
  fill(192, 192, 192); // Silver color
  for (int i = 0; i < 3; i++) {
    rect(width/2 - 75 + i * 25, height/2 - 75, 20, 50);
  }

  // Valve buttons
  fill(0); // Black color
  for (int i = 0; i < 3; i++) {
    ellipse(width/2 - 65 + i * 25, height/2 - 80, 10, 10);
  }

  noLoop(); // Draw only once
