  background(255);

  // Draw the line at the top
  stroke(0);
  strokeWeight(2);
  line(0, 50, width, 50);

  // Draw the spider
  float centerX = width / 2;
  float centerY = height / 2;

  // Draw the spider's body
  fill(0);
  ellipse(centerX, centerY, 60, 60);

