```processing
void setup() {
  size(800, 600);
}

void draw() {
  background(255);

  // Draw the line at the top
  stroke(0);
  line(0, 50, width, 50);

  // Draw the dumpling
  drawDumpling(width/2, height/2);
}

void drawDumpling(float x, float y) {
  // Dumpling wrapper
  fill(230, 230, 230);
  beginShape();
  vertex(x-50, y);
  bezierVertex(x-50, y-30, x+50, y-30, x+50, y);
  bezierVertex(x+50, y+30, x-50, y+30, x-50, y);
  endShape(CLOSE);

  // Dumpling pleats
  stroke(0);
  for (int i = 0; i < 6; i++) {
    float t = map(i, 0, 5, 0, 1);
    float px = bezierPoint(x-50, x-50, x+50, x+50, t);
    float py = bezierPoint(y, y-30, y-30, y, t);
    float qx = bezierPoint(x-50, x-50, x+50, x+50, t+0.01);
    float qy = bezierPoint(y, y-30, y-30, y, t+0.01);
    float angle = atan2(qy - py, qx - px);
    line(px, py, px + 15 * cos(angle + PI / 2), py + 15 * sin(angle + PI / 2));
  }
}
```

