```processing
void setup() {
  size(800, 800);
  background(255);
}

void draw() {
  // Draw the line at the top
  stroke(0);
  strokeWeight(5);
  line(0, 50, width, 50);

  // Draw the fork in the middle
  drawFork(width / 2, height / 2, 200, 20);
}

void drawFork(float x, float y, float length, float width) {
  // Draw the handle
  rectMode(CENTER);
  fill(0);
  rect(x, y, width, length / 2);

  // Draw the fork prongs
  float prongHeight = length / 2;
  float prongWidth = width / 4;
  float prongSpacing = width / 4;

  for (int i = 0; i < 4; i++) {
    float prongX = x - width / 2 + prongSpacing / 2 + i * prongSpacing;
    float prongY = y - prongHeight / 2;
    rect(prongX, prongY, prongWidth, prongHeight);
  }
}

void mouseClicked() {
  save("fork_image.png");
  exit();
}
```

