void drawWatermelon(float x, float y, float w, float h) {
  // Draw the watermelon shape
  fill(200, 50, 50);
  ellipse(x, y, w, h);

  // Draw the stripes
  int numStripes = 10;
  float stripeWidth = w / numStripes;
  for (int i = 0; i < numStripes; i++) {
    if (i % 2 == 0) {
      fill(150, 30, 30);
    } else {
      fill(200, 50, 50);
    }
    arc(x, y, w, h, i * stripeWidth, (i + 1) * stripeWidth);
  }

  // Draw the seeds
  fill(0);
  int numSeeds = 20;
  for (int i = 0; i < numSeeds; i++) {
    float seedX = x + random(-w/4, w/4);
    float seedY = y + random(-h/4, h/4);
    ellipse(seedX, seedY, 10, 5);
  }

  // Draw the shading
  fill(255, 100);
  arc(x, y, w, h, 0, PI);
}
```

