void drawBattery(float x, float y, float w, float h) {
  // Draw the main body of the battery
  stroke(0);
  strokeWeight(2);
  fill(200);
  rect(x, y, w, h);

  // Draw the positive terminal of the battery
  fill(0);
  rect(x + w, y + h * 0.25, w * 0.1, h * 0.5);

  // Draw the battery level indicator
  fill(0, 255, 0);
  float levelWidth = w * 0.8;
  float levelHeight = h * 0.8;
  float levelX = x + w * 0.1;
  float levelY = y + h * 0.1;
  rect(levelX, levelY, levelWidth, levelHeight);

  // Draw the battery level divisions
  stroke(255);
  strokeWeight(1);
  for (int i = 1; i < 4; i++) {
    float divisionX = levelX + (levelWidth / 4) * i;
    line(divisionX, levelY, divisionX, levelY + levelHeight);
  }
}
```

