  // Draw the keyboard
  int keyWidth = 40;
  int keyHeight = 50;
  int keySpacing = 5;
  int numRows = 4;
  int numCols = 12;
  int startX = (width - (numCols * (keyWidth + keySpacing))) / 2;
  int startY = (height - (numRows * (keyHeight + keySpacing))) / 2;

  for (int row = 0; row < numRows; row++) {
    for (int col = 0; col < numCols; col++) {
      int x = startX + col * (keyWidth + keySpacing);
      int y = startY + row * (keyHeight + keySpacing);

      // Draw the key
      fill(255);
      stroke(0);
      rect(x, y, keyWidth, keyHeight);

      // Draw the key label
      fill(0);
      textAlign(CENTER, CENTER);
      textSize(16);
      text(getKeyLabel(row, col), x + keyWidth / 2, y + keyHeight / 2);
    }
  }
}

String getKeyLabel(int row, int col) {
  String[][] keyLabels = {
    {"1", "2", "3", "4", "5", "6", "7", "8", "9", "0", "-", "="},
    {"Q", "W", "E", "R", "T", "Y", "U", "I", "O", "P", "[", "]"},
    {"A", "S", "D", "F", "G", "H", "J", "K", "L", ";", "'", "\\"},
    {"Z", "X", "C", "V", "B", "N", "M", ",", ".", "/"}
  };

  return keyLabels[row][col];
}
```

This code will create an 800x600 window with a line at the top and a simple keyboard illustration in the middle. The keys are labeled with characters, and you can easily modify the `getKeyLabel` function to change the labels or add more keys.

