```processing
void setup() {
  size(400, 400);
}

void draw() {
  background(255);

  // Draw the line at the top
  stroke(0);
  line(0, 50, width, 50);

  // Draw the umbrella
  drawUmbrella(200, 200);
}

void drawUmbrella(float x, float y) {
  // Draw the umbrella handle
  stroke(0);
  strokeWeight(5);
  line(x, y, x, y - 100);

  // Draw the umbrella canopy
  fill(200, 0, 0);
  arc(x, y - 100, 150, 100, PI, TWO_PI);

  // Draw the umbrella ribs
  strokeWeight(2);
  for (int i = 0; i < 6; i++) {
    float angle = PI + (i * PI / 6);
    float ribX = x + cos(angle) * 75;
    float ribY = y - 100 + sin(angle) * 50;
    line(x, y - 100, ribX, ribY);
  }
}
```

This code creates a 400x400 canvas, draws a line at the top, and then draws an umbrella in the middle. The `drawUmbrella` function takes the x and y coordinates of the umbrella's handle's bottom point and draws the umbrella handle, canopy, and ribs accordingly.

